import styled from "styled-components";

const Container = styled.div`
display: flex;
flex-direction: column;
align-items: center;
margin: 30px 0 10px;
font-family: Oswald;
`;
const OverviewComponent = (props) => {
    return(
        <Container>OverviewComponent</Container>
    )
}
export default OverviewComponent
